# Converts tpgeta in [0,55] to foldedEta in [0,27]
def foldtpgeta(tpgeta):
  foldedEta = -1
  if tpgeta >= 28 and tpgeta < 56:
    foldedEta = tpgeta - 28
  elif tpgeta >= 0 and tpgeta < 28:
    foldedEta = 27 - tpgeta
  return foldedEta

